import React, { useEffect } from "react";
import "./App.css";
import { ThemeProvider, createTheme } from "@mui/material/styles";
import Dashboard from "./components/Dashboard/Dashboard";
import TextSection from "./components/Dashboard/TextSection/TextSection";
import TableSection from "./components/Dashboard/TableSection/TableSection";
import ChartSection from "./components/Dashboard/ChartSection/ChartSection";
import OverviewSection from "./components/Dashboard/OverviewSection/OverviewSection";
import LastSensors from "./components/Dashboard/LastSensors/LastSensors";
// import { Order } from "./types/types";
// import { RootState } from "./types/interfaces";
import { ORDERS, CONTAINERS } from "../src/utils/testsObjectsInConstants";
// import { useDispatch, useSelector } from "react-redux";
import { useDispatch } from "react-redux";

const App: React.FC = () => {
  const theme = createTheme({
    palette: {
      primary: {
        main: "#556cd6", // основной цвет
      },
      secondary: {
        main: "#19857b", // второстепенный цвет
      },
      error: {
        main: "#ff6e40", // цвет для ошибок
      },
      // Вы можете добавить больше настроек для разных аспектов вашего интерфейса
    },
  });
  // const [orders, setOrders] = React.useState<Order[]>([]);
  // useEffect(() => {
  //   setOrders(ORDERS);
  // }, []);

  // const orders = useSelector((state: RootState) => state.orders);
  // const containers = useSelector((state: RootState) => state.containers);
  const dispatch = useDispatch();

  useEffect(() => {
    dispatch({ type: "SET_ORDERS", payload: ORDERS });
    dispatch({ type: "SET_CONTAINERS", payload: CONTAINERS });
  }, []);

  return (
    <ThemeProvider theme={theme}>
      <div className='App'>
        <Dashboard>
          {/* <OverviewSection orders={orders} /> */}
          <OverviewSection />
          <TextSection />
          <TableSection />
          <ChartSection />
        </Dashboard>
        <LastSensors />
      </div>
    </ThemeProvider>
  );
};

export default App;
